import { useParams } from 'react-router-dom';
import Header from '../Header';
import Sidebar from './Sidebar';
function UserProfile() {
    // Access the id parameter from the URL
    const { login } = useParams();

    return (
        <>
            <Header></Header>
            <div className="flex">
                <Sidebar />
                
            </div>
        </>

    );
}

export default UserProfile;
